import { Outlet, useNavigation } from "react-router-dom";
import Navigation from "./MainNavigation";

const RootLayout = () => {
    const navigate  = useNavigation();
    const navigated = navigate.state;
    return (
        <>
           <Navigation />
           <Outlet />
        </>
    );
};

export default RootLayout;
